svg.script:
			var planets = []
			var gm = 1
			var maxr = 1
			var maxrw = 10000
			var zoom = 1
			var time = 0
			var dots 
			var dots_parent
			var rings
			var rings_parent

			//statistic

			var dl2_min_ps = 1/0
			var dl2_min = 1/0
			var dl2_max_ps = 0
			var dl2_max = 0

			var worker
			if (!!window.Worker)
			{
				worker = new Worker("worker.js");
			}

			function removeChilds(node){
				while (node.firstChild) {
					node.removeChild(node.firstChild);
				}
			}

			function from_json(json){
				var data = JSON.parse(json)
				planets = data.planets
				gm = data.gm
				if (data.maxr) maxr = data.maxr;
				if (data.maxrw) maxrw = data.maxrw;
				if (data.zoom) zoom = data.zoom;
				time = data.time

				for (var i = 0; i < planets.length; i++){
					planets[i].newx = planets[i].x;
					planets[i].newy = planets[i].y;
					planets[i].newz = planets[i].z;
				}

				removeChilds(dots)
				removeChilds(rings)
			}

			function load()
			{
				var data
				var lsdata
				try{
					data = JSON.parse(window.location.hash.substr(1))

				}catch(e){	}
				try{
					lsdata = JSON.parse(localStorage["gravity2"])

				}catch(e){	}


				if (lsdata && data && lsdata.time && data.time && (data.time < lsdata.time))
					data = lsdata
				if (!data)
					data = lsdata




				dots = document.getElementById("dots")
				dots_parent = dots.parentNode
				rings = document.getElementById("rings")
				rings_parent = rings.parentNode


				if (data && data.gm && data.planets){
						planets = data.planets
						gm = data.gm
						maxr = data.maxr
						if (data.maxrw) maxrw = data.maxrw;
						zoom = data.zoom
						time = data.time

						for (var i = 0; i < planets.length; i++){
							planets[i].newx = planets[i].x;
							planets[i].newy = planets[i].y;
							planets[i].newz = planets[i].z;
						}

						removeChilds(dots)
						removeChilds(rings)
				}
				else
					for (var index = 0, dot = document.getElementById("dot"+index); dot; dot = document.getElementById("dot" + (++index)))
					{
						try{
						var data = JSON.parse(dot.getAttribute("data"))
						var x = data.planet_x
						var y = data.planet_y
						var z = data.planet_z

						planets.push({x: x, y: y, z: z, newx: x, newy: y, newz: z, 
						speed_x: data.speed_x,
						speed_y: data.speed_y,
						speed_z: data.speed_z,
						dot: dot,
						ring: document.getElementById("ring" + index)})
						}catch(e){
							console.log(e)
						}
					}


				if (planets.length == 0)
					for (i = 0; i < 100; i++)
					{
						var x = Math.random() 
						var y = Math.random() 
						var z = Math.random() 
						planets.push({x: x, y: y, z: z, newx: x, newy: y, newz: z, speed_x: 0, speed_y: 0, speed_z: 0})
					}
				else if (!(data && data.gm))
				{
					maxr = parseFloat(dots.getAttribute("maxr"))
					maxrw = parseFloat(dots.getAttribute("maxrw") || maxrw)
					zoom = parseFloat(dots.getAttribute("zoom"))
					gm = parseFloat(dots.getAttribute("gm"))
					time = parseFloat(dots.getAttribute("time"))
				}

				if (worker){

					worker.onmessage = function (event)
					{
						from_json(event.data)
					};

					worker.postMessage(to_json());
				}

				setInterval(move, 0)

				setTimeout(start, 40)
				//setInterval(function(){console.log(time, mps, fps, dl2_min, dl2_max, dl2_min_ps, dl2_max_ps); mps=0; fps=0; dl2_min_ps=1/0, dl2_max_ps = 0}, 1000)
				setInterval(save_to_hash, 60000)
			}




			function calc_new_xy(planet, force){


//				if (planet.max_gravity < Math.abs(gravity)){
//					planet.max_gravity = Math.abs(gravity)
//					planet.max_gravity_force = force
//				}

			}

			function set_xy(planet)
			{

//				planet.max_gravity = 0;
			}

			var mps = 0

			function move(){
				var mpsl = mps
				var timel = time
				var dl2_minl = dl2_min
				var dl2_maxl = dl2_max
				var dl2_minl_ps = dl2_min_ps
				var dl2_maxl_ps = dl2_max_ps
				var length = planets.length

				for (r=0; r < maxr; r++)
				{
					mpsl++
					timel++
					var planet = planets[0]
					var next

					for (i = 0; i < length; i++)
					{
						var x = planet.x
						var y = planet.y
						var z = planet.z

						var newx = planet.newx
						var newy = planet.newy
						var newz = planet.newz


						for (o = i+1; o < length; o++)
						{

							var force = planets[o]
							if (o == i+1)
								next = force

							var dx = force.x - x
							var dy = force.y - y
							var dz = force.z - z
							var dl2 =  dx * dx + dy * dy + dz * dz

							if (dl2 < dl2_minl)
								dl2_minl = dl2;
							else if (dl2 > dl2_maxl)
								dl2_maxl = dl2;

							if (dl2 < dl2_minl_ps)
								dl2_minl_ps = dl2;
							else if (dl2 > dl2_maxl_ps)
								dl2_maxl_ps = dl2;

							var gravity = gm / dl2


							var gdx, gdy, gdz

							newx += (gdx = gravity * dx)
							newy += (gdy = gravity * dy)
							newz += (gdz = gravity * dz)

							force.newx -= gdx 
							force.newy -= gdy 
							force.newz -= gdz 
						}

						planet.speed_x = (planet.newx = newx + planet.speed_x) - planet.x
						planet.speed_y = (planet.newy = newy + planet.speed_y) - planet.y
						planet.speed_z = (planet.newz = newz + planet.speed_z) - planet.z
						planet.x = planet.newx
						planet.y = planet.newy
						planet.z = planet.newz
						planet = next
					}
				}
				mps = mpsl
				time = timel
				dl2_min = dl2_minl
				dl2_max = dl2_maxl
				dl2_min_ps = dl2_minl_ps
				dl2_max_ps = dl2_maxl_ps	
			}

			var fps = 0

			var a = 0

			function setAttribute(ob, name, value){
				var old_value = ob.getAttribute(name)
				if (old_value && (old_value != "0")){
					if (Math.abs(old_value - value) > 0.05){
						ob.setAttribute(name, value);
						return true;
					}
				}
				else{
					ob.setAttribute(name, value);
				}

			}

			function to_json(){
				return JSON.stringify({"maxr": maxr,
				 "maxrw": maxrw,
				 "gm": gm,
				 "zoom": zoom,
				 "time": time,
				 "planets": planets}, ["maxr", "maxrw", "gm", "zoom", "time", "planets", "x", "y", "z", "speed_x", "speed_y", "speed_z"])
			}

			function save_to_hash(){
				var data_string = to_json()
				try{
					history.replaceState( null , null, "#" + data_string );
					console.log("replaceState")
				}catch(e){
					window.location.replace("#" + data_string)
					console.log("location.replace")
				}

				try{
					localStorage["gravity2"] = data_string
				}catch(e){}



			}


			function draw(){
				fps++
				//dots_parent.removeChild(dots);
				//rings_parent.removeChild(rings);
				//path_parent.removeChild(path);
				var d = []
				//a += 0.5
				for (i = 0; i < planets.length; i++)
				{
					var planet = planets[i]			
					var dot = planet.dot, ring = planet.ring;
					if ( !dot || !(dot.tagName) )
					{
						dot = document.createElementNS("http://www.w3.org/2000/svg","circle")
						ring = document.createElementNS("http://www.w3.org/2000/svg","circle")
						planet.dot = dot; planet.ring = ring;

						dot.setAttribute("id", "dot"+i)
						ring.setAttribute("id", "ring"+i)



						var color = Math.floor(0xFFFFFF/planets.length*i).toString(16)
						for (;color.length < 6;)
							color = "0" + color;

						dot.setAttribute("fill", "#" + color )

						dots.appendChild(dot)
						rings.appendChild(ring)


					}

					var x = planet.x, y = planet.y, z = planet.z;

					dot.setAttribute("data", '{\
"planet_x": '+x+', \
"planet_y": '+y+', \
"planet_z": '+z+', \
"speed_x": '+planet.speed_x+', \
"speed_y": '+planet.speed_y+', \
"speed_z": '+planet.speed_z+' }')



					x = x * Math.cos(a) + z  * Math.sin(a)
					z = - planet.x * Math.sin(a) + z  * Math.cos(a)

					x = 50 + x * zoom
					y = 50 + y * zoom
					z = (50 + z ) * zoom/10



					if (setAttribute(dot, "cx", x ))
						setAttribute(ring, "cx", x )

					if (setAttribute(dot, "cy", y ))
						setAttribute(ring, "cy", y )





					if (z > 0.1){
						if (setAttribute(ring, "r", z)){
							if (z < 0.5)
								setAttribute(dot, "r", z );
							else
								setAttribute(dot, "r", 0.5 );
						}
					}
					else
						if (setAttribute(ring, "r", 0))
							setAttribute(dot, "r", 0.1 );



				}
				dots.setAttribute("maxr", maxr)
				dots.setAttribute("maxrw", maxrw)
				dots.setAttribute("gm", gm)
				dots.setAttribute("zoom", zoom)
				dots.setAttribute("time", time)
//				path.setAttribute("d", d.join(" "))

				//rings_parent.appendChild(rings);
				//dots_parent.appendChild(dots);
				//path_parent.appendChild(path);

				if (!pause) {setTimeout(function(){ window.requestAnimationFrame(draw); }, 30) }
			}



			var draw_interval

			var pause = false;
			function start(){
				pause=false;
				window.requestAnimationFrame(draw); 
			}

			function stop(){
				pause=true;
			}

/** This is high-level function.
 * It must react to delta being more/less than zero.
 */
function handle(delta) {
		if (delta < 0)
			zoom=zoom*1.1;
		else
			zoom=zoom/1.1;
}

/** Event handler for mouse wheel event.
 */
function wheel(event){
		var delta = 0;
		if (!event) /* For IE. */
				event = window.event;
		if (event.wheelDelta) { /* IE/Opera. */
				delta = event.wheelDelta/120;
		} else if (event.detail) { /** Mozilla case. */
				/** In Mozilla, sign of delta is different than in IE.
				 * Also, delta is multiple of 3.
				 */
				delta = -event.detail/3;
		}
		/** If delta is nonzero, handle it.
		 * Basically, delta is now positive if wheel was scrolled up,
		 * and negative, if wheel was scrolled down.
		 */
		if (delta)
				handle(delta);
		/** Prevent default actions caused by mouse wheel.
		 * That might be ugly, but we handle scrolls somehow
		 * anyway, so don't bother here..
		 */
		if (event.preventDefault)
				event.preventDefault();
	event.returnValue = false;
}

/** Initialization code. 
 * If you use your own event management code, change it as required.
 */
if (window.addEventListener)
		/** DOMMouseScroll is for mozilla. */
		window.addEventListener('DOMMouseScroll', wheel, false);
/** IE/Opera. */
window.onmousewheel = document.onmousewheel = wheel;
